import classes from "./History.module.css";

export default function HistoryVacationTable({ data }) {
  return (
    <div>
      <h2>История отпусков</h2>
      <p>Во время отпуска сохраняется половина от основной ЗП</p>
      <table
        className={`${classes.generalTable} ${classes.historyVacation}`}
        id="history"
      >
        <thead>
          <tr>
            <td>Никнейм модератора</td>
            <td>Дата отпуска</td>
            <td>Дата выхода</td>
            <td>Количество дней</td>
            <td>Причина</td>
          </tr>
        </thead>
        <tbody>
          {data.map((value) => {
            return (
              <tr>
                <td>{value.user}</td>
                <td>{value.start}</td>
                <td>{value.end}</td>
                <td>{value.days}</td>
                <td>{value.cause}</td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
}
